import { ReactComponent as CheckSVG } from './check.svg';
import { ReactComponent as DeleteSVG} from './delete.svg';

const iconTypes = {
    'check': <CheckSVG />,
    'delete': <DeleteSVG />
};

const functionTypes = {
    'check': 'onComplete',
    'delete': 'onDelete'
}

function TodoIcon({ type, onComplete, onDelete, text }) {
    return (
        <span
            className={`Icon Icon-svg Icon-${type}`}
            onClick={() => {`on${type}`}}
        >
            {iconTypes[type]}
        </span>
    );
}

export { TodoIcon };
